  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a subset of the
  reef fish and benthic survey data collected by the NOAA Pacific islands Fisheries
  Science Center Coral Reef Ecosystem Division for the Pacific Resource Assessment
  and Monitoring Program marine survey missions in 2012 and 2013. Over that time period,
  surveys were conducted in the Pacific Remote Island Areas, American Samoa and the
  main Hawaiian Islands. The status of reefs in each region is first described in
  the wider U.S. Pacific context and then at the island scale for each of the regions.
  Data on fish biomass (total; by size class; by consumer group) and benthic cover
  (hard coral; macroalgae; encrusting algae; turf algae) are presented at the island
  level,  as well as maps showing survey sites.\",\n\t\"license_title\": \"License
